import "./EmployeeTable.css";
import Employee from '../Employee/Employee';

function EmployeeTable() {
  return (
    <div className='employeeTable'>

          <div className="row1">
              <h3ncl>Full Name</h3ncl>
              <h3>Job title</h3>
              <h3>Department</h3>
              <h3>Gender</h3>
              <h3>Age</h3>
          </div>
          <Employee/>

    </div>
  )
}

export default EmployeeTable
